República Dominicana.  2 mortos e 2 feridos durante um incidente confuso em Boca Canasta, Banyu.

 Dois jovens foram mortos e dois ficaram gravemente feridos por balas como resultado de um incidente confuso ocorrido em uma mercearia localizada na rua Maximo Gomez, na comunidade de Boca Canasta, no município de Bani.  Depois disso, houve uma briga entre um menor e um policial nacional chamado Encarnacion.
