Isso é do livro de Klaus Schwab, leia-o para saber o plano maligno deles.


Pelo menos 4 bilhões de "comedores inúteis" serão eliminados até o ano 2050 por meio de guerras limitadas, epidemias organizadas de doenças fatais de ação rápida e fome. Energia, comida e água devem ser mantidas em níveis de subsistência para os não-elite, começando com as populações brancas da Europa Ocidental e América do Norte e depois se espalhando para outras raças. A população do Canadá, Europa Ocidental e Estados Unidos será dizimada mais rapidamente do que em outros continentes, até que a população mundial atinja um nível administrável de 1 bilhão, dos quais 500 milhões serão de raças chinesas e japonesas, selecionadas por serem pessoas que foram arregimentados por séculos e que estão acostumados a obedecer à autoridade sem questionar. De tempos em tempos, haverá escassez artificial de comida e água e cuidados médicos para lembrar às massas que sua própria existência depende da boa vontade do Comitê.
